import React from "react";

const HistoricoDividendosLRED = () => {
  return (
    <div className="historico-container">
      <h2>Histórico de Dividendos - LRED11</h2>
      <p>Em breve serão exibidos gráficos e dados sobre dividendos.</p>
    </div>
  );
};

export default HistoricoDividendosLRED;
